INSERT INTO `cnvds` VALUES (99, 'CVE-2022-23202', 'CNVD-2022-15925', 'Adobe Creative Cloud Desktop不受控制搜索路径元素漏洞', '中(AV:N/AC:H/Au:N/C:P/I:P/A:P)', '2', 'Adobe Creative Cloud Desktop <= 2.7.0.13', 'AdobeCreativeCloudDesktopApplication是美国奥多比（Adobe）公司的一套用于在Creative云会员管理中心管理应用程序和服务的应用程序。该程序支持同步和共享文件、管理字体以及访问商业摄影和设计的资产库。AdobeCreativeCloudDesktop2.7.0.13及之前版本存在不受控制搜索路径元素漏洞。攻击者可利用该漏洞执行任意代码（受害用户必须下载恶意DLL文件，DLL文件需与安装程序放在同一文件夹中，这使其成为高度复杂的攻击媒介）。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-23202', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://helpx.adobe.com/security/products/creative-cloud/apsb22-11.html', 'AdobeCreativeCloudDesktop不受控制搜索路径元素漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322866', '(暂无验证信息)', '2022-03-02', '2022-02-18', '2022-03-02', '2022-03-02', '(无附件)', '2022-03-02', 'CNVD', '2022-03-04 17:29:53', NULL);
INSERT INTO `cnvds` VALUES (100, 'CVE-2022-23200', 'CNVD-2022-15926', 'Adobe After Effects越界写入漏洞（CNVD-2022-15926）', '中(AV:N/AC:M/Au:N/C:P/I:P/A:P)', '2', 'Adobe After Effects <= 22.1.1Adobe After Effects <= 18.4.3', 'AdobeAfterEffects是美国奥多比（Adobe）公司的一套视觉效果和动态图形制作软件。该软件主要用于2D和3D合成、动画制作和视觉特效制作等。AdobeAfterEffects22.1.1及之前版本和18.4.3及之前版本存在越界写入漏洞，该漏洞源于程序未对用户输入进行正确验证。攻击者可利用该漏洞执行任意代码。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-23200', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://helpx.adobe.com/security/products/after_effects/apsb22-09.html', 'AdobeAfterEffects越界写入漏洞（CNVD-2022-15926）的补丁：https://www.cnvd.org.cn/patchInfo/show/322871', '(暂无验证信息)', '2022-03-02', '2022-02-18', '2022-03-02', '2022-03-02', '(无附件)', '2022-03-02', 'CNVD', '2022-03-04 17:29:53', NULL);
