INSERT INTO `cnvds` VALUES (136, 'CVE-2022-21680', 'CNVD-2022-15958', 'marked拒绝服务漏洞（CNVD-2022-15958）', '中(AV:N/AC:L/Au:N/C:N/I:N/A:P)', '2', 'Marked marked 4.0.10', 'marked是一款使用JavaScript编写的Markdown解析器和编译器。marked存在安全漏洞，攻击者可利用漏洞导致正则表达式拒绝服务(ReDoS)。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-21680', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://github.com/markedjs/marked/releases/tag/v4.0.10', NULL, '(暂无验证信息)', '2022-03-02', '2022-01-18', '2022-03-02', '2022-03-02', '(无附件)', '2022-03-02', 'CNVD', '2022-03-04 17:29:54', NULL);
INSERT INTO `cnvds` VALUES (137, 'CVE-2022-21681', 'CNVD-2022-15959', 'marked拒绝服务漏洞', '中(AV:N/AC:L/Au:N/C:N/I:N/A:P)', '2', 'Marked marked 4.0.10', 'marked是一款使用JavaScript编写的Markdown解析器和编译器。marked中存在安全漏洞，攻击者可利用漏洞会导致对某些字符串的灾难性回溯并导致拒绝服务(DoS)。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-21681', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://github.com/markedjs/marked/security/advisories/GHSA-5v2h-r2cx-5xgj', NULL, '(暂无验证信息)', '2022-03-02', '2022-01-18', '2022-03-02', '2022-03-02', '(无附件)', '2022-03-02', 'CNVD', '2022-03-04 17:29:54', NULL);
INSERT INTO `cnvds` VALUES (138, 'CVE-2021-23566', 'CNVD-2022-15960', 'nanoid信息泄露漏洞', '低(AV:L/AC:L/Au:N/C:P/I:N/A:N)', '1', 'nanoid nanoid  3.0.0，<3.1.31', 'nanoid是用于JavaScript的小型、安全、URL友好、唯一的字符串ID生成器。nanoid存在漏洞，该漏洞源于nanoid容易通过valueOf()函数受到信息暴露的影响，该函数允许重现最后生成的id。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-23566', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://github.com/ai/nanoid/pull/328', 'nanoid信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323136', '(暂无验证信息)', '2022-03-02', '2022-01-18', '2022-03-02', '2022-03-02', '(无附件)', '2022-03-02', 'CNVD', '2022-03-04 17:29:54', NULL);
INSERT INTO `cnvds` VALUES (139, NULL, 'CNVD-2022-11159', '北京通达志成科技有限公司心通达OA系统存在信息泄露漏洞', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', '北京通达志成科技有限公司 心通达OA ', '心通达OA基于云计算模式的SaaS架构研发，满足政务云、工业云、教育云等智慧云平台的建设需求。北京通达志成科技有限公司心通达OA系统存在信息泄露漏洞，攻击者可利用该漏洞获取敏感信息。', '通用型漏洞', '', '厂商已发布了漏洞修复程序，请及时关注更新：http://www.8oa.cn', '北京通达志成科技有限公司心通达OA系统存在信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/320891', '已验证', '2022-03-02', '2022-01-16', '2022-02-17', '2022-02-18', '附件暂不公开', '2022-03-02', 'CNVD', '2022-03-04 17:29:54', NULL);
INSERT INTO `cnvds` VALUES (140, NULL, 'CNVD-2022-11160', '云视讯管理平台存在未授权访问漏洞', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', '北京小鱼易连科技有限公司 云视讯管理平台 ', '北京小鱼易连科技有限公司专注服务于政务、公检法司、教育、金融、医疗、企业等行业用户，“云、端、AI、开发平台”四位一体的云视频解决方案。云视讯管理平台存在未授权访问漏洞，攻击者可利用该漏洞获取敏感信息。', '通用型漏洞', '', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.xylink.com/', '云视讯管理平台存在未授权访问漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/320611', '已验证', '2022-03-02', '2022-01-16', '2022-02-17', '2022-02-17', '附件暂不公开', '2022-03-02', 'CNVD', '2022-03-04 17:29:54', NULL);
INSERT INTO `cnvds` VALUES (141, 'CVE-2022-21706', 'CNVD-2022-15523', 'Zulip server存在未明漏洞（CNVD-2022-15523）', '中(AV:N/AC:L/Au:N/C:P/I:P/A:N)', '2', 'Zulip Zulip Server ', 'Zulipserver是美国Zulip公司的一款开源的团队聊天应用程序。Zulipserver存在安全漏洞，该漏洞源于驻留多个组织的zlipServer部署很容易受到攻击，在一个组织中创建的邀请(可能是一个具有较高权限的角色)可以被用来加入任何其他组织。这绕过了对用户电子邮件地址所需域的任何限制，可以用来获得对只有邀请才能访问的组织的访问权。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-21706', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://github.com/zulip/zulip/security/advisories/GHSA-6xmj-2wcm-p2jc', 'Zulipserver存在未明漏洞（CNVD-2022-15523）的补丁：https://www.cnvd.org.cn/patchInfo/show/322641', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:00', NULL);
INSERT INTO `cnvds` VALUES (142, 'CVE-2022-24710', 'CNVD-2022-15524', 'Weblate跨站脚本漏洞', '中(AV:N/AC:L/Au:S/C:P/I:P/A:N)', '2', 'Weblate Weblate <4.11', 'Weblate是一个Copyleft的基于web的自由软件持续本地化系统。Weblate存在跨站脚本漏洞，该漏洞源于4.11之前的版本未能正确地中和用户名和语言字段中使用的用户输入。由于这种不适当的中和，可能会通过这些字段执行跨站点脚本编写。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-24710', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://github.com/WeblateOrg/weblate/security/advisories/GHSA-6jp6-9rf9-gc66', 'Weblate跨站脚本漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322626', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
INSERT INTO `cnvds` VALUES (143, 'CVE-2022-0764', 'CNVD-2022-15525', 'strapi操作系统命令注入漏洞', '中(AV:L/AC:L/Au:M/C:C/I:C/A:P)', '2', 'strapi strapi null', 'Strapi是一套开源的无头内容管理系统（CMS）。Strapi存在操作系统命令注入漏洞，该漏洞源于GitHub库中的任意命令注入。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-0764', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://cxsecurity.com/cveshow/CVE-2022-0764/', 'strapi操作系统命令注入漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322661', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
INSERT INTO `cnvds` VALUES (144, 'CVE-2022-0763', 'CNVD-2022-15526', 'microweber跨站脚本漏洞（CNVD-2022-15526）', '中(AV:N/AC:L/Au:M/C:P/I:P/A:P)', '2', 'Microweber Microweber <1.3', 'Microweber是美国Microweber社区的一套可提供拖拽功能的网上商店管理系统。该系统包括添加商品、图片等模块。Microweber存在跨站脚本漏洞，该漏洞源于WEB应用缺少对客户端数据的正确验证。攻击者可利用该漏洞执行客户端代码。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-0763', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://cxsecurity.com/cveshow/CVE-2022-0763/', 'microweber跨站脚本漏洞（CNVD-2022-15526）的补丁：https://www.cnvd.org.cn/patchInfo/show/322651', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
INSERT INTO `cnvds` VALUES (145, 'CVE-2022-0723', 'CNVD-2022-15527', 'Microweber跨站脚本漏洞（CNVD-2022-15527）', '高(AV:N/AC:L/Au:S/C:C/I:C/A:C)', '3', 'Microweber Microweber <1.2.11', 'Microweber是美国Microweber社区的一套可提供拖拽功能的网上商店管理系统。该系统包括添加商品、图片等模块。GitHub存在跨站脚本漏洞，该漏洞源于WEB应用缺少对客户端数据的正确验证。攻击者可利用该漏洞执行客户端代码。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-0723', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://cxsecurity.com/cveshow/CVE-2022-0723/', 'Microweber跨站脚本漏洞（CNVD-2022-15527）的补丁：https://www.cnvd.org.cn/patchInfo/show/322666', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
INSERT INTO `cnvds` VALUES (146, 'CVE-2021-3967', 'CNVD-2022-15528', 'zulip访问控制错误漏洞', '中(AV:N/AC:H/Au:M/C:P/I:P/A:P)', '2', 'Zulip Zulip <4.10', 'Zulip是Zulip团队的一款功能强大的开源群聊应用程序。用于将实时聊天的即时性与线程对话的生产力优势相结合。Zulip存在访问控制错误漏洞，该漏洞源于GitHub库中存在错误的访问控制。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-3967', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://cxsecurity.com/cveshow/CVE-2021-3967/', 'zulip访问控制错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322676', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
INSERT INTO `cnvds` VALUES (147, 'CVE-2022-0772', 'CNVD-2022-15529', 'Librenms跨站脚本漏洞（CNVD-2022-15529）', '中(AV:N/AC:L/Au:M/C:P/I:P/A:P)', '2', 'LibreNMS LibreNMS ', 'Librenms是Librenms社区的一套基于PHP和MySQL的开源网络监控系统。该系统具有自定义警报、自动发现网络环境和自动更新等特点。Librenms存在跨站脚本漏洞，该漏洞源于WEB应用缺少对客户端数据的正确验证。攻击者可利用该漏洞执行客户端代码。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-0772', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://cxsecurity.com/cveshow/CVE-2022-0772/', 'Librenms跨站脚本漏洞（CNVD-2022-15529）的补丁：https://www.cnvd.org.cn/patchInfo/show/322706', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
INSERT INTO `cnvds` VALUES (148, 'CVE-2021-38993', 'CNVD-2022-15530', 'IBM VIOS smbcd输入验证错误漏洞', '中(AV:L/AC:L/Au:N/C:N/I:N/A:C)', '2', 'IBM AIX 7.1IBM AIX 7.2IBM VIOS 3.1IBM AIX 7.3', 'IBMVios是美国IBM公司的PowerVm?Editions硬件功能的一部分。有助于在服务器内的客户端逻辑分区之间共享物理I/O资源。IBMVIOSsmbcd存在输入验证错误漏洞，该漏洞源于守护程序中的本地拒绝服务。目前没有详细漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38993', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：http://aix.software.ibm.com/aix/efixes/security/smbcd_advisory.asc', 'IBMVIOSsmbcd输入验证错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322561', '(暂无验证信息)', '2022-03-01', '2022-02-28', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
INSERT INTO `cnvds` VALUES (149, 'CVE-2021-38995', 'CNVD-2022-15531', 'IBM VIOS输入验证错误漏洞（CNVD-2022-15531）', '中(AV:L/AC:L/Au:N/C:N/I:N/A:C)', '2', 'IBM AIX 7.1IBM AIX 7.2IBM VIOS 3.1IBM AIX 7.3', 'IBMAIX是美国IBM公司的一款为IBMPower体系架构开发的一种基于开放标准的UNIX操作系统。IBMVIOS存在输入验证错误漏洞，该漏洞源于在AIX内核中未能对用户提供的输入进行充分的验证。攻击者可利用该漏洞来执行拒绝服务(DoS)攻击。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38995', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://www.cybersecurity-help.cz/vdb/SB2022022318', 'IBMVIOS输入验证错误漏洞（CNVD-2022-15531）的补丁：https://www.cnvd.org.cn/patchInfo/show/322566', '(暂无验证信息)', '2022-03-01', '2022-02-28', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
INSERT INTO `cnvds` VALUES (150, 'CVE-2021-38994', 'CNVD-2022-15532', 'IBM VIOS输入验证错误漏洞', '中(AV:L/AC:L/Au:N/C:N/I:N/A:C)', '2', 'IBM AIX 7.1IBM AIX 7.2IBM VIOS 3.1IBM AIX 7.3', 'IBMAIX是美国IBM公司的一款为IBMPower体系架构开发的一种基于开放标准的UNIX操作系统。IBMVIOS中存在输入验证错误漏洞，该漏洞源于产品没有对用户提供的输入进行充分的验证。攻击者可通过该漏洞运行专门设计的程序来执行拒绝服务(DoS)攻击。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38994', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：http://aix.software.ibm.com/aix/efixes/security/kernel_advisory3.asc', 'IBMVIOS输入验证错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322571', '(暂无验证信息)', '2022-03-01', '2022-02-28', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 17:41:02', NULL);
