INSERT INTO `cnvds` VALUES (155, 'CVE-2022-0723', 'CNVD-2022-15527', 'Microweber跨站脚本漏洞（CNVD-2022-15527）', '高(AV:N/AC:L/Au:S/C:C/I:C/A:C)', '3', 'Microweber Microweber <1.2.11', 'Microweber是美国Microweber社区的一套可提供拖拽功能的网上商店管理系统。该系统包括添加商品、图片等模块。GitHub存在跨站脚本漏洞，该漏洞源于WEB应用缺少对客户端数据的正确验证。攻击者可利用该漏洞执行客户端代码。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-0723', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://cxsecurity.com/cveshow/CVE-2022-0723/', 'Microweber跨站脚本漏洞（CNVD-2022-15527）的补丁：https://www.cnvd.org.cn/patchInfo/show/322666', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (156, 'CVE-2021-3967', 'CNVD-2022-15528', 'zulip访问控制错误漏洞', '中(AV:N/AC:H/Au:M/C:P/I:P/A:P)', '2', 'Zulip Zulip <4.10', 'Zulip是Zulip团队的一款功能强大的开源群聊应用程序。用于将实时聊天的即时性与线程对话的生产力优势相结合。Zulip存在访问控制错误漏洞，该漏洞源于GitHub库中存在错误的访问控制。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-3967', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://cxsecurity.com/cveshow/CVE-2021-3967/', 'zulip访问控制错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322676', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (157, 'CVE-2022-0772', 'CNVD-2022-15529', 'Librenms跨站脚本漏洞（CNVD-2022-15529）', '中(AV:N/AC:L/Au:M/C:P/I:P/A:P)', '2', 'LibreNMS LibreNMS ', 'Librenms是Librenms社区的一套基于PHP和MySQL的开源网络监控系统。该系统具有自定义警报、自动发现网络环境和自动更新等特点。Librenms存在跨站脚本漏洞，该漏洞源于WEB应用缺少对客户端数据的正确验证。攻击者可利用该漏洞执行客户端代码。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-0772', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://cxsecurity.com/cveshow/CVE-2022-0772/', 'Librenms跨站脚本漏洞（CNVD-2022-15529）的补丁：https://www.cnvd.org.cn/patchInfo/show/322706', '(暂无验证信息)', '2022-03-01', '2022-03-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (158, 'CVE-2021-38993', 'CNVD-2022-15530', 'IBM VIOS smbcd输入验证错误漏洞', '中(AV:L/AC:L/Au:N/C:N/I:N/A:C)', '2', 'IBM AIX 7.1IBM AIX 7.2IBM VIOS 3.1IBM AIX 7.3', 'IBMVios是美国IBM公司的PowerVm?Editions硬件功能的一部分。有助于在服务器内的客户端逻辑分区之间共享物理I/O资源。IBMVIOSsmbcd存在输入验证错误漏洞，该漏洞源于守护程序中的本地拒绝服务。目前没有详细漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38993', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：http://aix.software.ibm.com/aix/efixes/security/smbcd_advisory.asc', 'IBMVIOSsmbcd输入验证错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322561', '(暂无验证信息)', '2022-03-01', '2022-02-28', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (159, 'CVE-2021-38995', 'CNVD-2022-15531', 'IBM VIOS输入验证错误漏洞（CNVD-2022-15531）', '中(AV:L/AC:L/Au:N/C:N/I:N/A:C)', '2', 'IBM AIX 7.1IBM AIX 7.2IBM VIOS 3.1IBM AIX 7.3', 'IBMAIX是美国IBM公司的一款为IBMPower体系架构开发的一种基于开放标准的UNIX操作系统。IBMVIOS存在输入验证错误漏洞，该漏洞源于在AIX内核中未能对用户提供的输入进行充分的验证。攻击者可利用该漏洞来执行拒绝服务(DoS)攻击。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38995', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://www.cybersecurity-help.cz/vdb/SB2022022318', 'IBMVIOS输入验证错误漏洞（CNVD-2022-15531）的补丁：https://www.cnvd.org.cn/patchInfo/show/322566', '(暂无验证信息)', '2022-03-01', '2022-02-28', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (160, 'CVE-2021-38994', 'CNVD-2022-15532', 'IBM VIOS输入验证错误漏洞', '中(AV:L/AC:L/Au:N/C:N/I:N/A:C)', '2', 'IBM AIX 7.1IBM AIX 7.2IBM VIOS 3.1IBM AIX 7.3', 'IBMAIX是美国IBM公司的一款为IBMPower体系架构开发的一种基于开放标准的UNIX操作系统。IBMVIOS中存在输入验证错误漏洞，该漏洞源于产品没有对用户提供的输入进行充分的验证。攻击者可通过该漏洞运行专门设计的程序来执行拒绝服务(DoS)攻击。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38994', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：http://aix.software.ibm.com/aix/efixes/security/kernel_advisory3.asc', 'IBMVIOS输入验证错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322571', '(暂无验证信息)', '2022-03-01', '2022-02-28', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (161, 'CVE-2022-22333', 'CNVD-2022-15533', 'IBM Sterling Secure Proxy缓冲区溢出漏洞', '中(AV:A/AC:L/Au:N/C:N/I:N/A:C)', '2', 'IBM IBM Sterling Secure Proxy 3.4.3.2IBM IBM Sterling Secure Proxy 6.0.3.0IBM IBM Sterling Secure Proxy 6.0.2.0', 'IBMSterlingSecureProxy是IBM公司的一款用于确保组织非保护区(DMZ)中文件安全传输的应用程序代理，通过多因素认证、SSL会话中断、入站防火墙漏洞修补、协议检查和其他控件来确保可信区域的安全性。IBMSterlingSecureProxy6.0.3.0,6.0.2.0,和3.4.3.2版本和IBMSterlingExternalAuthenticationServer存在安全漏洞。该漏洞源于SecureZone中基于Jetty的GUI对提交的表单内容大小缺少有效验证。攻击者可利用该漏洞通过提交特制的HTTP请求利用该漏洞发起拒绝服务攻击。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-22333', '厂商已发布了漏洞修复程序，请及时关注更新:https://www.ibm.com/support/pages/node/6558796', 'IBMSterlingSecureProxy缓冲区溢出漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322576', '(暂无验证信息)', '2022-03-01', '2022-02-25', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (162, 'CVE-2022-25307', 'CNVD-2022-15534', 'WordPress和WordPress plugin跨站脚本漏洞', '中(AV:N/AC:L/Au:N/C:P/I:P/A:N)', '2', 'WordPress WP Statistics plugin ', 'WordPress是Wordpress基金会的一套使用PHP语言开发的博客平台。该平台支持在PHP和MySQL的服务器上架设个人博客网站。WordPressplugin是WordPress开源的一个应用插件。WordPresspluginWPStatistics存在跨站脚本漏洞，攻击者可利用该漏洞注入任意web脚本，当网站管理员查看网站统计数据时执行。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-25307', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://plugins.trac.wordpress.org/changeset?sfp_email=&sfph_mail=&reponame=&old=2679983%40wp-statistics&new=2679983%40wp-statistics&sfp_email=&sfph_mail=', 'WordPress和WordPressplugin跨站脚本漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322711', '(暂无验证信息)', '2022-03-01', '2022-02-25', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (163, 'CVE-2021-43826', 'CNVD-2022-15542', 'Envoy资源管理错误漏洞（CNVD-2022-15542）', '高(AV:N/AC:L/Au:N/C:N/I:N/A:C)', '3', 'Envoy Envoy ', 'Envoy是一款开源的分布式代理服务器。Envoy存在资源管理错误漏洞，该漏洞源于当为上游隧道配置“envoy_v3_api_field_extensions.filters.network.tcp_proxy.v3.TcpProxy.tunneling_config”时发生崩溃，并且下游连接断开，而上游连接或http/2流仍然存在。没有解决此问题的方法。建议用户升级。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-43826', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://github.com/envoyproxy/envoy/security/advisories/GHSA-cmx3-fvgf-83mf', 'Envoy资源管理错误漏洞（CNVD-2022-15542）的补丁：https://www.cnvd.org.cn/patchInfo/show/322721', '(暂无验证信息)', '2022-03-01', '2022-02-24', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (164, 'CVE-2022-21654', 'CNVD-2022-15535', 'Envoy信任管理问题漏洞（CNVD-2022-15535）', '高(AV:N/AC:H/Au:N/C:C/I:C/A:N)', '3', 'Envoy Envoy ', 'Envoy是一款开源的分布式代理服务器。Envoy存在信任管理问题漏洞，该漏洞源于Envoy的tls允许在某些证书验证设置从默认配置更改后重用。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-21654', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://github.com/envoyproxy/envoy/commit/e9f936d85dc1edc34fabd0a1725ec180f2316353', 'Envoy信任管理问题漏洞（CNVD-2022-15535）的补丁：https://www.cnvd.org.cn/patchInfo/show/322716', '(暂无验证信息)', '2022-03-01', '2022-02-24', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (165, 'CVE-2021-46594', 'CNVD-2022-16164', 'Bentley Systems MicroStation缓冲区溢出漏洞（CNVD-2022-16164）', '中(AV:N/AC:M/Au:N/C:P/I:N/A:N)', '2', 'Bentley Systems Bentley View <10.16.02.*Bentley Systems Bentley Microstation <10.16.02.*', 'BentleySystemsMicroStation是美国BentleySystems公司的一个用于二维和三维设计和绘图的Cad软件平台。BentleySystemsMicroStation存在缓冲区溢出漏洞，攻击者可利用该漏洞与其他漏洞一起在当前进程的上下文中执行任意代码。', '通用型漏洞', 'https://www.zerodayinitiative.com/advisories/ZDI-22-181/', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.bentley.com/en/common-vulnerability-exposure/BE-2021-0005', 'BentleySystemsMicroStation缓冲区溢出漏洞（CNVD-2022-16164）的补丁：https://www.cnvd.org.cn/patchInfo/show/322971', '(暂无验证信息)', '2022-03-01', '2022-02-10', '2022-03-03', '2022-03-03', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (166, 'CVE-2021-46575', 'CNVD-2022-16165', 'Bentley Systems MicroStation资源管理错误漏洞（CNVD-2022-16165）', '中(AV:N/AC:M/Au:N/C:P/I:P/A:P)', '2', 'Bentley Systems Bentley View <10.16.02.*Bentley Systems Bentley Microstation <10.16.02.*', 'BentleySystemsMicroStation是美国BentleySystems公司的一个用于二维和三维设计和绘图的Cad软件平台。BentleySystemsMicroStation存在资源管理错误漏洞，攻击者可利用该漏洞在当前进程的上下文中执行代码。', '通用型漏洞', 'https://www.zerodayinitiative.com/advisories/ZDI-22-162/', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.bentley.com/en/common-vulnerability-exposure/BE-2021-0005', 'BentleySystemsMicroStation资源管理错误漏洞（CNVD-2022-16165）的补丁：https://www.cnvd.org.cn/patchInfo/show/322966', '(暂无验证信息)', '2022-03-01', '2022-02-10', '2022-03-03', '2022-03-03', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
