INSERT INTO `cnvds` VALUES (195, 'CVE-2021-38960', 'CNVD-2022-15536', 'IBM OPENBMC OP910信息泄露漏洞', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', 'IBM OPENBMC OP920 IBM OPENBMC OP930 IBM OPENBMC OP940 ', 'IBMOPENBMCOP910是美国国际商用机器公司（IBM）公司的一个POWER8和POWER9模拟器。IBMOPENBMCOP920、OP930和OP940存在安全漏洞，未经身份验证的攻击者可利用该漏洞获取敏感信息。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38960', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://www.ibm.com/support/pages/node/6529322', 'IBMOPENBMCOP910信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322596', '(暂无验证信息)', '2022-03-01', '2022-02-10', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (196, 'CVE-2022-21363', 'CNVD-2022-15473', 'Oracle MySQL Connectors输入验证错误漏洞（CNVD-2022-15473）', '中(AV:N/AC:M/Au:S/C:P/I:P/A:P)', '2', 'Oracle MySQL Connectors <= 8.0.27', 'OracleMySQL是美国甲骨文（Oracle）公司的一套开源的关系数据库管理系统。MySQLConnectors是其中的一个连接使用MySQL的应用程序的驱动程序。OracleMySQLConnectors(组件:Connector/J)8.0.27及之前版本存在输入验证错误漏洞。攻击者可利用该漏洞通过多种协议进行网络访问，从而破坏OracleMySQLConnectors，导致OracleMySQLConnectors被接管。', '通用型漏洞', 'http://www.cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2022-21363', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://www.oracle.com/security-alerts/cpujan2022.html', 'OracleMySQLConnectors输入验证错误漏洞（CNVD-2022-15473）的补丁：https://www.cnvd.org.cn/patchInfo/show/318921', '(暂无验证信息)', '2022-03-01', '2022-01-26', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (197, 'CVE-2022-21349', 'CNVD-2022-15474', 'Oracle GraalVM输入验证错误漏洞（CNVD-2022-15474）', '中(AV:N/AC:L/Au:N/C:N/I:N/A:P)', '2', 'Oracle Oracle Java SE 7u321Oracle Oracle Java SE 8u311Oracle Oracle GraalVM Enterprise Edition 20.3.4Oracle Oracle GraalVM Enterprise Edition 21.3.0', 'OracleGraalVM是美国甲骨文（Oracle）公司的一套使用Java语言编写的即时编译器。GraalVMEnterpriseEdition是GraalVM的企业版。OracleGraalVM存在输入验证错误漏洞，该漏洞源于OracleGraalVM企业版中的2D组件中的输入验证不正确。远程未经身份验证的攻击者可以利用此漏洞进行服务中断。', '通用型漏洞', 'http://www.oracle.com/security-alerts/cpujan2022.html?3082', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：http://www.oracle.com/security-alerts/cpujan2022.html?3082', 'OracleGraalVM输入验证错误漏洞（CNVD-2022-15474）的补丁：https://www.cnvd.org.cn/patchInfo/show/322466', '(暂无验证信息)', '2022-03-01', '2022-01-24', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (198, 'CVE-2022-21291', 'CNVD-2022-15475', 'Oracle GraalVM输入验证错误漏洞（CNVD-2022-15475）', '中(AV:N/AC:L/Au:N/C:N/I:P/A:N)', '2', 'Oracle Oracle Java SE 7u321Oracle Oracle Java SE 8u311Oracle Oracle Java SE 11.0.13Oracle Oracle Java SE 17.01Oracle Oracle GraalVM Enterprise Edition 20.3.4Oracle Oracle GraalVM Enterprise Edition 21.3.0', 'OracleGraalVM是美国甲骨文（Oracle）公司的一套使用Java语言编写的即时编译器。该产品支持多种编程语言和执行模式。GraalVMEnterpriseEdition是GraalVM的企业版。OracleGraalVM存在输入验证错误漏洞，该漏洞的存在是由于OracleGraalVM企业版中序列化组件中的输入验证不正确。远程未经身份验证的攻击者可以利用此漏洞来操纵数据。', '通用型漏洞', 'http://www.oracle.com/security-alerts/cpujan2022.html?3082', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：http://www.oracle.com/security-alerts/cpujan2022.html?3082', 'OracleGraalVM输入验证错误漏洞（CNVD-2022-15475）的补丁：https://www.cnvd.org.cn/patchInfo/show/322471', '(暂无验证信息)', '2022-03-01', '2022-01-24', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
