INSERT INTO `cnvds` VALUES (201, 'CVE-2022-21366', 'CNVD-2022-15478', 'Oracle GraalVM输入验证错误漏洞', '中(AV:N/AC:L/Au:N/C:N/I:N/A:P)', '2', 'Oracle Oracle Java SE 11.0.13Oracle Oracle Java SE 17.01Oracle Oracle GraalVM Enterprise Edition 20.3.4Oracle Oracle GraalVM Enterprise Edition 21.3.0', 'OracleGraalVM是美国甲骨文（Oracle）公司的一套使用Java语言编写的即时编译器。GraalVMEnterpriseEdition是GraalVM的企业版。OracleGraalVM存在输入验证错误漏洞，该漏洞的存在是由于OracleGraalVM企业版中序列化组件中的输入验证不正确。远程未经身份验证的攻击者可以利用此漏洞来操纵数据。', '通用型漏洞', 'https://www.oracle.com/security-alerts/cpujan2022.html', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://www.oracle.com/security-alerts/cpujan2022.html', 'OracleGraalVM输入验证错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322486', '(暂无验证信息)', '2022-03-01', '2022-01-24', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (202, 'CVE-2022-21380', 'CNVD-2022-15479', 'Oracle MySQL输入验证错误漏洞（CNVD-2022-15479）', '中(AV:A/AC:H/Au:S/C:P/I:P/A:P)', '2', 'Oracle MySQL Cluster <7.4.34Oracle MySQL Cluster <7.5.24Oracle MySQL Cluster <7.6.20Oracle MySQL Cluster <8.0.27', 'OracleMySQL是美国甲骨文（Oracle）公司的一套开源的关系数据库管理系统。MySQLServer是其中的一个数据库服务器组件。OracleMySQL的MySQLCluster产品中存在输入验证错误漏洞，攻击者可利用漏洞访问连接到执行MySQLCluster的硬件的物理通信段来破坏MySQLCluster。成功的攻击需要来自攻击者以外的人的人机交互。成功攻击此漏洞可导致MySQLCluster被接管。', '通用型漏洞', 'https://www.oracle.com/security-alerts/cpujan2022.html', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://www.oracle.com/security-alerts/cpujan2022.html', 'OracleMySQL输入验证错误漏洞（CNVD-2022-15479）的补丁：https://www.cnvd.org.cn/patchInfo/show/322491', '(暂无验证信息)', '2022-03-01', '2022-01-24', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
