INSERT INTO `cnvds` VALUES (212, 'CVE-2022-21341', 'CNVD-2022-15489', 'Oracle Java SE输入验证错误漏洞（CNVD-2022-15489）', '中(AV:N/AC:L/Au:N/C:N/I:N/A:P)', '2', 'Oracle Oracle Java SE 7u321Oracle Oracle Java SE 8u311Oracle Oracle Java SE 11.0.13Oracle Oracle Java SE 17.01Oracle Oracle GraalVM Enterprise Edition 20.3.4Oracle Oracle GraalVM Enterprise Edition 21.3.0', 'OracleJavaSE是美国甲骨文（Oracle）公司的一款用于开发和部署桌面、服务器以及嵌入设备和实时环境中的Java应用程序。OracleJavaSE存在输入验证错误漏洞，攻击者可利用此漏洞可能会导致未经授权的能力导致OracleJavaSE、OracleGraalVM企业版的部分拒绝服务（部分DOS）。', '通用型漏洞', 'https://www.oracle.com/security-alerts/cpujan2022.html', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://www.oracle.com/security-alerts/cpujan2022.html', 'OracleJavaSE输入验证错误漏洞（CNVD-2022-15489）的补丁：https://www.cnvd.org.cn/patchInfo/show/322051', '(暂无验证信息)', '2022-03-01', '2022-01-24', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (213, 'CVE-2022-23314', 'CNVD-2022-15490', 'MCMS SQL注入漏洞', '高(AV:N/AC:L/Au:N/C:P/I:P/A:P)', '3', 'MingSoft mcms 5.2.4', 'Mcms是中国铭飞（MingSoft）公司的一个完整开源的J2ee系统。MCMSv5.2.4版本存在SQL注入漏洞，该漏洞源于/ms/mdiy/model/importJson.do中缺少对于SQL数据的过滤和转义。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-23314', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://gitee.com/mingSoft/MCMS', NULL, '(暂无验证信息)', '2022-03-01', '2022-01-24', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (214, 'CVE-2022-23408', 'CNVD-2022-15491', 'wolfSSL安全特征问题漏洞', '中(AV:N/AC:L/Au:N/C:P/I:P/A:N)', '2', 'wolfSSL wolfSSL 5.*，<5.1.1', 'Wolfssl（CyaSSL）是美国Wolfssl公司的一个针对嵌入式系统开发人员使用的小的、可移植的嵌入式SSL编程库。wolfSSL存在安全漏洞，该漏洞源于在某些情况下，5.1.1之前的x使用非随机IV值。这将影响使用TLS1.1或1.2或TLS1.1或1.2的AES-CBC或DES3连接(没有AEAD)。发生这种情况是因为在internal.c中的BuildMessage中错误的内存初始化。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-23408', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://github.com/wolfSSL/wolfssl/blob/master/ChangeLog.md#wolfssl-release-511-jan-3rd-2022', 'wolfSSL安全特征问题漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322526', '(暂无验证信息)', '2022-03-01', '2022-01-19', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (215, 'CVE-2022-21700', 'CNVD-2022-15492', 'Object Computing micronaut资源管理错误漏洞', '中(AV:N/AC:L/Au:N/C:N/I:N/A:P)', '2', 'Object Computing Micronaut <3.2.7', 'ObjectComputingmicronaut是美国ObjectComputing公司的一款基于JVM的全栈框架，它主要用于构建模块化微服务和无服务器应用程序。ObjectComputingMicronaut存在资源管理错误漏洞，该漏洞源于在受影响的版本中，发送无效的ContentType标头会导致DefaultArgumentConversionContext中的内存泄露，因为此类型在静态状态下被错误地使用。＃＃＃Impact发送无效的ContentType标头会导致`DefaultArgumentConversionContext`中的内存泄露，因为此类型在静态状态下被错误地使用。目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-21700', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://github.com/micronaut-projects/micronaut-core/security/advisories/GHSA-2457-2263-mm9f', 'ObjectComputingmicronaut资源管理错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322531', '(暂无验证信息)', '2022-03-01', '2022-01-19', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
