INSERT INTO `cnvds` VALUES (234, 'CVE-2022-21849', 'CNVD-2022-15510', 'Microsoft Windows IKE Extension远程代码执行漏洞', '高(AV:N/AC:M/Au:N/C:C/I:C/A:C)', '3', 'Microsoft Windows 10 Microsoft Windows 10 1607Microsoft Windows Server 2016 Microsoft Windows Server 2019 Microsoft Windows Server 2022 nullMicrosoft Windows 10 1809Microsoft Windows 10 1909Microsoft Windows 10 20H2Microsoft Windows Server 20H2Microsoft Windows 10 21H1Microsoft Windows 11 Microsoft Windows 10 21H2', 'MicrosoftWindows是美国微软（Microsoft）公司的一套个人设备使用的操作系统。MicrosoftWindowsIKEExtension远程代码执行漏洞，目前没有详细漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-21849', '厂商已发布了漏洞修复程序，请及时关注更新：https://portal.msrc.microsoft.com/en-US/security-guidance/advisory/CVE-2022-21849', 'MicrosoftWindowsIKEExtension远程代码执行漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322701', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (235, 'CVE-2022-0170', 'CNVD-2022-15511', 'peertube访问控制错误漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'PeerTube peertube ', 'PeerTube是一个去中心化的视频分享服务平台。用于制作视频项目。peertube存在访问控制错误漏洞，攻击者可利用该漏洞获取敏感信息。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-0170', '厂商已发布了漏洞修复程序，请及时关注更新：https://huntr.dev/bounties/727d8600-88bc-4dde-8dea-ee3d192600e5', 'peertube访问控制错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322696', '已验证', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (236, 'CVE-2021-43052', 'CNVD-2022-15512', 'TIBCO FTL信任管理问题漏洞', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', 'TIBCO TIBCO FTL-Enterprise Edition <=6.7.2TIBCO TIBCO FTL-Community Edition <=6.7.2TIBCO TIBCO FTL - Developer Edition <=6.7.2', 'TibcoFtl是美国Tibco公司的一个应用程序到应用程序的消息传递系统。专为低延迟和高性能而设计。TIBCOFTL存在信任管理问题漏洞，该漏洞源于默认领域服务器中使用的硬编码机密，攻击者可利用该漏洞绕过身份验证。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-43052', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.tibco.com/support/advisories/2022/01/tibco-security-advisory-january-11-2022-tibco-ftl-2021-43052', 'TIBCOFTL信任管理问题漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322691', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (237, 'CVE-2021-43054', 'CNVD-2022-15513', 'Tibco Eftl信息泄露漏洞（CNVD-2022-15513）', '中(AV:N/AC:L/Au:S/C:P/I:P/A:P)', '2', 'TIBCO TIBCO eFTL-Community Edition <=6.7.2TIBCO TIBCO eFTL-Developer Edition <=6.7.2TIBCO TIBCO eFTL-Enterprise Edition <=6.7.2', 'TibcoEftl是美国Tibco公司的一个TibcoFtl和TibcoEnterpriseMessageService™的附加组件。将TibcoFtl®消息传递扩展到Web浏览器和移动设备等平台。TIBCOeFTL存在信息泄露漏洞，具有网络访问权限的低权限攻击者可利用该漏洞生成API令牌，该令牌可访问具有任意权限的任何其他频道。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-43054', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.tibco.com/support/advisories/2022/01/tibco-security-advisory-january-11-2022-tibco-eftl-2021-43054', 'TibcoEftl信息泄露漏洞（CNVD-2022-15513）的补丁：https://www.cnvd.org.cn/patchInfo/show/322686', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (238, 'CVE-2021-43055', 'CNVD-2022-15514', 'Tibco Eftl信息泄露漏洞', '中(AV:N/AC:L/Au:S/C:P/I:P/A:P)', '2', 'TIBCO TIBCO eFTL-Community Edition <=6.7.2TIBCO TIBCO eFTL-Developer Edition <=6.7.2TIBCO TIBCO eFTL-Enterprise Edition <=6.7.2', 'TibcoEftl是美国Tibco公司的一个TibcoFtl和TibcoEnterpriseMessageService™的附加组件。将TibcoFtl®消息传递扩展到Web浏览器和移动设备等平台。TIBCOeFTL存在信息泄露漏洞，该漏洞源于客户端继承最初在受影响的系统上连接的客户端的权限。目前没有详细漏洞细节提供。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-43055', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.tibco.com/support/advisories/2022/01/tibco-security-advisory-january-11-2022-tibco-eftl-2021-43055', 'TibcoEftl信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322681', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (239, 'CVE-2021-43053', 'CNVD-2022-15515', 'TIBCO FTL信息泄露漏洞', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', 'TIBCO TIBCO FTL-Enterprise Edition <=6.7.2TIBCO TIBCO FTL-Community Edition <=6.7.2TIBCO TIBCO FTL - Developer Edition <=6.7.2', 'TIBCOFTL是美国TIBCOSoftware（TibcoSoftware）公司的一套从应用程序到应用程序的消息传递系统。TIBCOFTL存在信息泄露漏洞，攻击者可利用该漏洞获取连接到RealmServer的另一个应用程序的群集密钥。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-43053', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.tibco.com/support/advisories/2022/01/tibco-security-advisory-january-11-2022-tibco-ftl-2021-43053', 'TIBCOFTL信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322671', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (240, 'CVE-2021-43974', 'CNVD-2022-15516', 'Sysaid Technologies SysAid存在未明漏洞（CNVD-2022-15516）', '中(AV:N/AC:L/Au:N/C:N/I:P/A:N)', '2', 'SysAid ITIL 20.4.74 b10', 'SysaidTechnologiesSysAid是以色列SysAidTechnologies（SysaidTechnologies）公司的一套IT服务管理解决方案。SysAidITIL存在安全漏洞，攻击者可利用该漏洞发布注册数据来创建新帐户，而无需事先进行身份验证。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-43974', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.sysaid.com/product/on-premises/latest-release', 'SysaidTechnologiesSysAid存在未明漏洞（CNVD-2022-15516）的补丁：https://www.cnvd.org.cn/patchInfo/show/322656', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (241, 'CVE-2021-43972', 'CNVD-2022-15517', 'Sysaid Technologies SysAid存在未明漏洞', '中(AV:N/AC:L/Au:S/C:N/I:C/A:N)', '2', 'SysAid ITIL 20.4.74 b10', 'SysaidTechnologiesSysAid是以色列SysAidTechnologies（SysaidTechnologies）公司的一套IT服务管理解决方案。SysAidITIL存在安全漏洞，攻击者可利用该漏洞通过HTTPPOST中的tempFile和fileName参数将服务器文件系统上的任意文件复制到Web根目录。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-43972', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.sysaid.com/product/on-premises/latest-release', 'SysaidTechnologiesSysAid存在未明漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322646', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (242, 'CVE-2021-43971', 'CNVD-2022-15518', 'Sysaid Technologies SysAid SQL注入漏洞', '中(AV:N/AC:L/Au:S/C:P/I:P/A:P)', '2', 'SysAid ITIL 20.4.74 b10', 'SysaidTechnologiesSysAid是以色列SysAidTechnologies（SysaidTechnologies）公司的一套IT服务管理解决方案。SysAidITIL存在SQL注入漏洞，攻击者可利用该漏洞通过filterText参数执行任意SQL命令。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-43971', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.sysaid.com/it-service-management-software/incident-management', 'SysaidTechnologiesSysAidSQL注入漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322636', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (243, 'CVE-2021-44647', 'CNVD-2022-15519', 'Lua存在未明漏洞', '低(AV:L/AC:L/Au:N/C:N/I:N/A:P)', '1', 'Lua Lua 5.4.4Lua Lua 5.4.2', 'Lua是Lua（LUA）团队的一款轻量级、扩展的开源脚本语言。Lua5.4.4和5.4.2存在安全漏洞，该漏洞源于ldebug.c中funcnamefromcode函数存在类型混淆漏洞，攻击者可利用该漏洞导致本地拒绝服务。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-44647', '厂商已发布了漏洞修复程序，请及时关注更新：http://lua-users.org/lists/lua-l/2021-11/msg00204.html', 'Lua存在未明漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322631', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (244, 'CVE-2022-21671', 'CNVD-2022-15520', 'crosis信息泄露漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'crosis crosis <7.3.1', 'crosis是一个使用Replit容器协议的JavaScript客户端。crosis存在信息泄露漏洞，攻击者可利用该漏洞获取用于连接到Repl的令牌。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-21671', '厂商已发布了漏洞修复程序，请及时关注更新：https://github.com/replit/crosis/security/advisories/GHSA-7w54-gp8x-f33m', 'crosis信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322621', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (245, 'CVE-2022-21669', 'CNVD-2022-15521', 'PuddingBot信任管理问题漏洞', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', 'PuddingBot PuddingBot <=0.0.6-b933652', 'PuddingBot是一个群组管理机器人。PuddingBot存在信任管理问题漏洞，攻击者可利用该漏洞在main.py中获取bot令牌。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-21669', '厂商已发布了漏洞修复程序，请及时关注更新：https://github.com/PuddingBot/pudding-bot/security/advisories/GHSA-cxgr-xpmj-9qjm', 'PuddingBot信任管理问题漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322616', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (246, 'CVE-2022-23094', 'CNVD-2022-15522', 'Libreswan代码问题漏洞（CNVD-2022-15522）', '中(AV:N/AC:L/Au:N/C:N/I:N/A:P)', '2', 'Libreswan Libreswan >=4.2，<=4.5', 'Libreswan是一个类似于Openswan的IPsec实现，它主要用于保证数据传输中的安全性、完整性问题。Libreswan存在代码问题漏洞，攻击者可利用该漏洞向应用程序发送特制的IKEv1数据包，在对被拒绝的IKEv1数据包进行日志记录操作期间触发NULL指针取消引用错误，并使pluto守护程序崩溃。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2022-23094', '厂商已发布了漏洞修复程序，请及时关注更新：https://libreswan.org/security/CVE-2022-23094/CVE-2022-23094.txt', 'Libreswan代码问题漏洞（CNVD-2022-15522）的补丁：https://www.cnvd.org.cn/patchInfo/show/322601', '(暂无验证信息)', '2022-03-01', '2022-01-13', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (247, 'CVE-2017-13908', 'CNVD-2022-15493', 'Apple macOS High Sierra权限提升漏洞（CNVD-2022-15493）', '中(AV:L/AC:L/Au:N/C:P/I:P/A:P)', '2', 'Apple OS X El Capitan 10.11.6Apple macOS Sierra 10.12.6Apple OS X Mountain Lion <=10.8', 'ApplemacOSHighSierra是美国苹果（Apple）公司的一套专为Mac计算机所开发的专用操作系统。ApplemacOSHighSierra存在安全漏洞，攻击者可利用该漏洞通过SMB共享执行非可执行文本文件。', '通用型漏洞', 'http://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2017-13908', '目前厂商已经发布了升级补丁以修复这个安全问题，请到厂商的主页下载：https://support.apple.com/en-us/HT208144', 'ApplemacOSHighSierra权限提升漏洞（CNVD-2022-15493）的补丁：https://www.cnvd.org.cn/patchInfo/show/322506', '(暂无验证信息)', '2022-03-01', '2021-12-27', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (248, 'CVE-2017-13909', 'CNVD-2022-15494', 'Apple macOS High Sierra信息泄露漏洞（CNVD-2022-15494）', '低(AV:L/AC:L/Au:N/C:P/I:N/A:N)', '1', 'Apple OS X Mountain Lion <=10.8', 'ApplemacOSHighSierra是美国苹果（Apple）公司的一套专为Mac计算机所开发的专用操作系统。ApplemacOSHighSierra存在安全漏洞，该漏洞源于敏感令牌的存储存在问题。攻击者可利用该漏洞可能获得对iCloud认证令牌的访问权。', '通用型漏洞', 'http://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2017-13909', '目前厂商已经发布了升级补丁以修复这个安全问题，请到厂商的主页下载：https://support.apple.com/en-us/HT208144', 'ApplemacOSHighSierra信息泄露漏洞（CNVD-2022-15494）的补丁：https://www.cnvd.org.cn/patchInfo/show/322501', '(暂无验证信息)', '2022-03-01', '2021-12-27', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (249, 'CVE-2018-4478', 'CNVD-2022-15496', 'Apple macOS High Sierra权限提升漏洞（CNVD-2022-15496）', '高(AV:L/AC:L/Au:N/C:C/I:C/A:C)', '3', 'Apple macOS High Sierra 10.13.4', 'ApplemacOSHighSierra是美国苹果（Apple）公司的一套专为Mac计算机所开发的专用操作系统。ApplemacOSHighSierra存在安全漏洞，该漏洞源于逻辑验证问题。攻击者可利用该漏洞提升特权。', '通用型漏洞', 'http://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2018-4478', '目前厂商已经发布了升级补丁以修复这个安全问题，请到厂商的主页下载：https://support.apple.com/en-us/HT208849', 'ApplemacOSHighSierra权限提升漏洞（CNVD-2022-15496）的补丁：https://www.cnvd.org.cn/patchInfo/show/322511', '(暂无验证信息)', '2022-03-01', '2021-12-27', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (250, 'CVE-2017-13905', 'CNVD-2022-15497', 'Apple macOS High Sierra权限提升漏洞', '中(AV:N/AC:M/Au:N/C:P/I:P/A:P)', '2', 'Apple macOS High Sierra 10.13.1', 'ApplemacOSHighSierra是美国苹果（Apple）公司的一套专为Mac计算机所开发的专用操作系统。ApplemacOSHighSierra存在安全漏洞，该漏洞源于竞态条件存在问题。攻击者可利用该漏洞导致提升特权。', '通用型漏洞', 'http://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2017-13905', '目前厂商已经发布了升级补丁以修复这个安全问题，请到厂商的主页下载：https://support.apple.com/en-us/HT208325', 'ApplemacOSHighSierra权限提升漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322521', '(暂无验证信息)', '2022-03-01', '2021-12-27', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (251, 'CVE-2021-38893', 'CNVD-2022-15537', 'IBM Business Automation Workflow跨站脚本漏洞（CNVD-2022-15537）', '低(AV:N/AC:M/Au:S/C:N/I:P/A:N)', '1', 'IBM IBM Business Automation Workflow V21.0IBM IBM Business Automation Workflow V20.0IBM IBM Business Automation Workflow V19.0IBM IBM Business Automation Workflow V18.0IBM IBM Business Process Manager V8.6IBM IBM Business Process Manager V8.5', 'IBMBusinessAutomationWorkflow是美国IBM公司的一套工作流程自动化解决方案。该产品主要用于工作流程管理、合规性管理，并具有工作流程可见性和可扩展等特点。IBMBusinessAutomationWorkflow存在安全漏洞，该漏洞源于IBM业务自动化工作流容易受到存储的跨站点脚本编制的影响。攻击者可利用该漏洞允许用户在WebUI中嵌入任意JavaScript代码，从而改变预期的功能，从而可能导致可信会话中的凭证泄露。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38893', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://www.ibm.com/support/pages/node/6527782', 'IBMBusinessAutomationWorkflow跨站脚本漏洞（CNVD-2022-15537）的补丁：https://www.cnvd.org.cn/patchInfo/show/322581', '(暂无验证信息)', '2022-03-01', '2021-12-21', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (252, 'CVE-2021-39050', 'CNVD-2022-15538', 'IBM i缓冲区溢出漏洞', '中(AV:L/AC:L/Au:N/C:P/I:P/A:P)', '2', 'IBM IBM i2 Analyst s Notebook 9.2.1IBM IBM i2 Analyst s Notebook 9.2.2IBM IBM i2 Analyst s Notebook 9.2.0', 'IBMi是美国IBM公司的一套运行在IBMPowerSystems和IBMPureSystems中的操作系统。IBMi存在缓冲区错误漏洞，该漏洞源于软件错误的边界检查，导致软件容易受到基于堆栈的缓冲区溢出的攻击，本地攻击者可利用该漏洞可能会实现溢出缓冲区并获得较低级别的特权。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-39050', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://www.ibm.com/support/pages/node/6525258', 'IBMi缓冲区溢出漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322586', '(暂无验证信息)', '2022-03-01', '2021-12-16', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (253, 'CVE-2020-4152', 'CNVD-2022-15539', 'IBM QRadar Network Security信息泄露漏洞（CNVD-2022-15539）', '中(AV:N/AC:M/Au:N/C:P/I:N/A:N)', '2', 'IBM IBM QRadar Network Security 5.4.0IBM IBM QRadar Network Security 5.5.0', 'IBMQRadarNetworkSecurity是美国IBM公司的一个网络安全管理器。用于提供对网络上的活动和用户的更好的可见性和控制，同时使用深度数据包检查、启发式和基于行为的分析来检测和预防高级威胁。IBMQRadarNetworkSecurity存在安全漏洞，该漏洞源于IBMQRadarNetworkSecurity以明文形式在通信通道中传输敏感或安全关键数据。攻击者可利用该漏洞使用中间人技术获得这些数据。', '通用型漏洞', 'https://exchange.xforce.ibmcloud.com/vulnerabilities/174267', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://www.ibm.com/support/pages/node/6514403', 'IBMQRadarNetworkSecurity信息泄露漏洞（CNVD-2022-15539）的补丁：https://www.cnvd.org.cn/patchInfo/show/322591', '(暂无验证信息)', '2022-03-01', '2021-12-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (254, 'CVE-2021-29873', 'CNVD-2022-15540', 'IBM Flash System 900存在未明漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:P)', '2', 'IBM Flash System 900 ', 'IbmFlashSystem900是美国Ibm公司的一款经过全面优化的全闪存存储阵列。用于加速推动业务发展。IBMFlashSystem900存在安全漏洞，该漏洞源于IBMFlashSystem900存在外壳逃逸漏洞。攻击者可利用该漏洞获取敏感信息，并由于受限制的shellescape漏洞而导致拒绝服务。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-29873', '目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：https://www.ibm.com/support/pages/node/6507091', 'IBMFlashSystem900存在未明漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322606', '(暂无验证信息)', '2022-03-01', '2021-12-01', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (255, 'CVE-2021-38981', 'CNVD-2022-15541', 'IBM Tivoli Key Lifecycle Manager信息泄露漏洞（CNVD-2022-15541）', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', 'IBM IBM Security Key Lifecycle Manager >=3.0，<=3.0.0.4IBM IBM Security Key Lifecycle Manager >=3.0.1，<=3.0.1.5IBM IBM Security Key Lifecycle Manager >=4.0，<=4.0.0.3IBM IBM Security Guardium Key Lifecycle Manager >=4.1.0，<=4.1.0.1IBM IBM Security Guardium Key Lifecycle Manager 4.1.1', 'IBMTivoliKeyLifecycleManager（TKLM）是美国IBM公司的一套密钥生命周期管理软件。该软件为存储设备提供密钥存储、密钥维护和密钥生命周期管理等功能。IBMTivoliKeyLifecycleManager存在安全漏洞，攻击者可利用该漏洞在浏览器中返回详细的技术错误消息时获取敏感信息，该信息可用于对系统的进一步攻击。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-38981', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://www.ibm.com/support/pages/node/6516048', 'IBMTivoliKeyLifecycleManager信息泄露漏洞（CNVD-2022-15541）的补丁：https://www.cnvd.org.cn/patchInfo/show/322611', '(暂无验证信息)', '2022-03-01', '2021-11-16', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (256, 'CVE-2020-25722', 'CNVD-2022-15498', 'Samba权限许可和访问控制问题漏洞（CNVD-2022-15498）', '中(AV:N/AC:L/Au:S/C:P/I:P/A:P)', '2', 'Samba Samba >=4.0.0，<4.13.14Samba Samba >=4.14.0，<4.14.10Samba Samba >=4.15.0，<4.15.2', 'Samba是用于Linux和Unix的标准Windows互操作性程序套件。Samba存在权限许可和访问控制问题漏洞，该漏洞源于在sambaADDC实现存储数据的访问和一致性检查的方式中发现了多个缺陷。攻击者可以利用此缺陷来导致整个域遭到破坏。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2020-25722', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://vigilance.fr/vulnerability/Samba-multiple-vulnerabilities-36843', NULL, '(暂无验证信息)', '2022-03-01', '2021-11-12', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (257, 'CVE-2020-25721', 'CNVD-2022-15499', 'Samba授权问题漏洞（CNVD-2022-15499）', '高(AV:N/AC:L/Au:N/C:C/I:P/A:P)', '3', 'Samba Samba ', 'Samba是用于Linux和Unix的标准Windows互操作性程序套件。Samba存在授权问题漏洞，目前没有详细的漏洞细节提供。', '通用型漏洞', 'https://access.redhat.com/security/cve/cve-2020-25721', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://vigilance.fr/vulnerability/Samba-multiple-vulnerabilities-36843', NULL, '(暂无验证信息)', '2022-03-01', '2021-11-12', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (258, 'CVE-2020-25719', 'CNVD-2022-15500', 'Samba安全绕过漏洞（CNVD-2022-15500）', '高(AV:N/AC:L/Au:N/C:C/I:C/A:C)', '3', 'Samba Samba ', 'Samba是用于Linux和Unix的标准Windows互操作性程序套件。Samba存在安全漏洞，该漏洞源于在作为ActiveDirectory域控制器的Samba实现基于Kerberos名称的身份验证的方式中发现了一个缺陷。攻击者可以利用此漏洞获取整个域的安全漏洞。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2020-25719', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://vigilance.fr/vulnerability/Samba-multiple-vulnerabilities-36843', NULL, '(暂无验证信息)', '2022-03-01', '2021-11-12', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (259, 'CVE-2020-25718', 'CNVD-2022-15501', 'Samba权限许可和访问控制问题漏洞（CNVD-2022-15501）', '高(AV:N/AC:L/Au:N/C:P/I:P/A:P)', '3', 'Samba Samba <=4.0.0', 'Samba是用于Linux和Unix的标准Windows互操作性程序套件。Samba存在权限许可和访问控制问题漏洞，该漏洞源于在作为ActiveDirectory域控制器的samba能够支持RODC（只读域控制器）的方式中发现了一个缺陷。攻击者可利用漏洞允许RODC打印管理员票证。', '通用型漏洞', 'https://www.samba.org/samba/security/CVE-2020-25718.html', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://vigilance.fr/vulnerability/Samba-multiple-vulnerabilities-36843', NULL, '(暂无验证信息)', '2022-03-01', '2021-11-12', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (260, 'CVE-2020-25717', 'CNVD-2022-15502', 'Samba权限许可和访问控制问题漏洞', '高(AV:N/AC:L/Au:S/C:C/I:C/A:N)', '3', 'Samba Samba >=4.14.0，<4.14.10Samba Samba >=4.15.0，<4.15.2Samba Samba >=3.0.0，<4.13.14', 'Samba是用于Linux和Unix的标准Windows互操作性程序套件。Samba存在权限许可和访问控制问题漏洞，攻击者可利用此漏洞导致权限升级。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2020-25717', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://vigilance.fr/vulnerability/Samba-multiple-vulnerabilities-36843', NULL, '(暂无验证信息)', '2022-03-01', '2021-11-12', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (261, 'CVE-2016-2124', 'CNVD-2022-15503', 'Samba访问控制错误漏洞', '中(AV:N/AC:M/Au:N/C:P/I:N/A:N)', '2', 'Samba Samba >=4.14.0，<4.14.10Samba Samba >=4.15.0，<4.15.2Samba Samba >=3.0.0，<4.13.14', 'Samba是用于Linux和Unix的标准Windows互操作性程序套件。Samba存在访问控制错误漏洞，攻击者可利用此漏洞检索网络发送的明文密码。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2016-2124', '目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：https://vigilance.fr/vulnerability/Samba-multiple-vulnerabilities-36843', NULL, '(暂无验证信息)', '2022-03-01', '2021-11-12', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (262, 'CVE-2021-22943', 'CNVD-2022-15504', 'Ubiquiti Networks UniFi Protect授权问题漏洞', '高(AV:A/AC:L/Au:N/C:C/I:C/A:C)', '3', 'Ubiquiti Networks UniFi Protect application <=1.18.1', 'UbiquitiNetworksUniFiProtect是美国优比快（UbiquitiNetworks）公司的一款网络视频录像机。UbiquitiNetworksUniFiProtectapplication1.18.1及之前版本存在安全漏洞，攻击者可利用漏洞获得网络访问权限的恶意行为者可以控制分配给该网络的Protect摄像机。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-22943', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://community.ui.com/releases/Security-Advisory-Bulletin-019-019/90a00abe-d6b6-43c6-92d4-0a0342f1506f', 'UbiquitiNetworksUniFiProtect授权问题漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322546', '(暂无验证信息)', '2022-03-01', '2021-09-02', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (263, 'CVE-2021-22944', 'CNVD-2022-15505', 'Ubiquiti Networks UniFi Protect访问控制错误漏洞', '高(AV:A/AC:L/Au:S/C:C/I:C/A:C)', '3', 'Ubiquiti Networks UniFi Protect application <=1.18.1', 'UbiquitiNetworksUniFiProtect是美国优比快（UbiquitiNetworks）公司的一款网络视频录像机。UbiquitiNetworksUniFiProtect中存在访问控制错误漏洞，该漏洞源于产品未对仅有视图访问权限、网络访问权限的访问者添加有效的权限控制。攻击者可利用该漏洞获得与程序所有者相同的权限。', '通用型漏洞', 'https://nvd.nist.gov/vuln/detail/CVE-2021-22944', '目前厂商已发布升级补丁以修复漏洞，补丁获取链接：https://community.ui.com/releases/Security-Advisory-Bulletin-019-019/90a00abe-d6b6-43c6-92d4-0a0342f1506f', 'UbiquitiNetworksUniFiProtect访问控制错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/322551', '(暂无验证信息)', '2022-03-01', '2021-09-02', '2022-03-01', '2022-03-01', '(无附件)', '2022-03-01', 'CNVD', '2022-03-04 23:04:34', NULL);
INSERT INTO `cnvds` VALUES (264, 'CVE-2022-25199', 'CNVD-2022-16709', 'Jenkins SCP publisher Plugin访问控制错漏洞', '中(AV:N/AC:L/Au:S/C:P/I:P/A:P)', '2', 'Jenkins SCP publisher Plugin <=1.8', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsSCPpublisherPlugin1.8及更早版本存在访问控制错误漏洞，该漏洞源于不会在实现表单验证的方法中执行权限检查，攻击者可利用该漏洞连接到SSH服务器。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2323', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2323', 'JenkinsSCPpublisherPlugin访问控制错漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323266', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:19', NULL);
INSERT INTO `cnvds` VALUES (265, 'CVE-2022-25198', 'CNVD-2022-16710', 'Jenkins SCP publisher Plugin跨站请求伪造漏洞', '中(AV:N/AC:M/Au:N/C:P/I:P/A:P)', '2', 'Jenkins SCP publisher Plugin <=1.8', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsSCPpublisherPlugin1.8及更早版本存在跨站请求伪造漏洞，该漏洞源于WEB应用未充分验证请求是否来自可信用户，攻击者可利用该漏洞连接到SSH服务器。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2323', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2323', 'JenkinsSCPpublisherPlugin跨站请求伪造漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323271', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (266, 'CVE-2022-25197', 'CNVD-2022-16711', 'Jenkins HashiCorp Vault Plugin任意文件读取漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins HashiCorp Vault Plugin <=336.v182c0fbaaeb7', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsHashiCorpVaultPlugin336.v182c0fbaaeb7及更早版本存在任意文件读取漏洞，该漏洞源于该插件实现了允许代理进程读取Jenkins控制器文件系统上的任意文件的功能。攻击者可利用此漏洞控制代理进程来读取Jenkins控制器文件系统上的任意文件。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2521', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2521', 'JenkinsHashiCorpVaultPlugin任意文件读取漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323276', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (267, 'CVE-2022-25196', 'CNVD-2022-16712', 'Jenkins GitLab Authentication Plugin用户重定向漏洞', '中(AV:N/AC:M/Au:S/C:P/I:P/A:N)', '2', 'Jenkins GitLab Authentication Plugin <=1.13', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsGitLabAuthenticationPlugin1.13及更早版本存在用户重定向漏洞，该漏洞源于在身份验证过程开始时将HTTPReferer标头记录为URL查询参数的一部分，攻击者可利用此漏洞将用户重定向到攻击者指定的任意URL。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-1833', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-1833', 'JenkinsGitLabAuthenticationPlugin用户重定向漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323286', '(暂无验证信息)', '2022-03-04', '2022-03-03', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (268, 'CVE-2022-25195', 'CNVD-2022-16713', 'Jenkins autonomiq Plugin访问控制错误漏洞', '中(AV:N/AC:L/Au:S/C:N/I:P/A:N)', '2', 'Jenkins autonomiq Plugin <=1.15', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsautonomiqPlugin1.15及更早版本中存在访问控制错误漏洞，该漏洞源于不会在实现表单验证的方法中执行权限检查，攻击者可利用该漏洞连接到任意URL。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2545', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2545', 'JenkinsautonomiqPlugin访问控制错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323281', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (269, 'CVE-2022-25194', 'CNVD-2022-16714', 'Jenkins autonomiq Plugin跨站请求伪造漏洞', '中(AV:N/AC:M/Au:N/C:P/I:P/A:P)', '2', 'Jenkins autonomiq Plugin <=1.15', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsautonomiqPlugin1.15及更早版本中存在跨站请求伪造漏洞，该漏洞源于WEB应用未充分验证请求是否来自可信用户，攻击者可利用该漏洞使用攻击者指定的用户名和密码连接到攻击者指定的URL。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2545', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2545', 'JenkinsautonomiqPlugin跨站请求伪造漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323291', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (270, 'CVE-2022-25193', 'CNVD-2022-16715', 'Jenkins Snow Commander Plugin访问控制错误漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins Snow Commander Plugin <=2.0', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsSnowCommanderPlugin2.0及更早版本存在访问控制错误漏洞，该漏洞源于不会在实现表单验证的方法中执行权限检查。攻击者可利用该漏洞通过攻击者指定的凭据ID连接到攻击者指定的Web服务器，捕获存储在Jenkins中的凭据。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2536', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2536', 'JenkinsSnowCommanderPlugin访问控制错误漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323296', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (271, 'CVE-2022-25192', 'CNVD-2022-16716', 'Jenkins Snow Commander Plugin跨站请求伪造漏洞', '中(AV:N/AC:M/Au:N/C:P/I:P/A:P)', '2', 'Jenkins Snow Commander Plugin <=2.0', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsSnowCommanderPlugin2.0及更早版本存在跨站请求伪造漏洞，该漏洞源于WEB应用未充分验证请求是否来自可信用户。攻击者可利用该漏洞通过攻击者指定的凭据ID连接到攻击者指定的Web服务器，捕获存储在Jenkins中的凭据。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2536', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2536', 'JenkinsSnowCommanderPlugin跨站请求伪造漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323306', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (272, 'CVE-2022-25191', 'CNVD-2022-16717', 'Jenkins Agent Server Parameter Plugin跨站脚本漏洞', '低(AV:N/AC:M/Au:S/C:N/I:P/A:N)', '1', 'Jenkins Agent Server Parameter Plugin <=1.0', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsAgentServerParameterPlugin1.0及更早版本存在跨站脚本漏洞，该漏洞源于没有转义代理服务器参数的参数名。攻击者可利用此漏洞获取管理员cookie。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2268', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2268', 'JenkinsAgentServerParameterPlugin跨站脚本漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323301', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (273, 'CVE-2022-25190', 'CNVD-2022-16718', 'Jenkins Conjur Secrets Plugin授权问题漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins Conjur Secrets Plugin <=1.0.11', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsConjurSecretsPlugin1.0.11及更早版本存在授权问题漏洞，该漏洞源于不会在HTTP端点中执行权限检查。攻击者可利用该漏洞使用OverallRead权限枚举存储在Jenkins中的凭证id。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2350', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2350', 'JenkinsConjurSecretsPlugin授权问题漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323311', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (274, 'CVE-2022-25189', 'CNVD-2022-16719', 'Jenkins Custom Checkbox Parameter Plugin跨站脚本漏洞', '中(AV:N/AC:L/Au:S/C:N/I:P/A:N)', '2', 'Jenkins Custom Checkbox Parameter Plugin <=1.1', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsCustomCheckboxParameterPlugin1.1及更早版本存在跨站脚本漏洞，该漏洞源于没有转义自定义复选框参数的参数名。攻击者可利用此漏洞获取管理员cookie。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2266', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2266', 'JenkinsCustomCheckboxParameterPlugin跨站脚本漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323316', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (275, 'CVE-2022-25188', 'CNVD-2022-16720', 'Jenkins Fortify Plugin路径遍历漏洞', '中(AV:N/AC:L/Au:S/C:N/I:P/A:N)', '2', 'Jenkins Fortify Plugin <=20.2.34', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsFortifyPlugin20.2.34及更早版本存在路径遍历漏洞，该漏洞源于没有对其Pipeline步骤的appName和appVersion参数进行清理，攻击者可利用该漏洞通过ItemConfigure权限在Jenkins控制器文件系统上写入内容或覆盖xml文件。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2214', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2214', 'JenkinsFortifyPlugin路径遍历漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323321', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (276, 'CVE-2022-25187', 'CNVD-2022-16721', 'Jenkins Support Core Plugin信息泄露漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins Support Core Plugin <2.79', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsSupportCorePlugin2.79及更早版本存在信息泄露漏洞，该漏洞源于没有在支持包中编辑一些敏感信息。攻击者可利用此漏洞获取敏感信息。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2186', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2186', 'JenkinsSupportCorePlugin信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323331', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (277, 'CVE-2022-25186', 'CNVD-2022-16722', 'Jenkins HashiCorp Vault Plugin信息泄露漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins HashiCorp Vault Plugin <=3.8.0', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsHashiCorpVaultPlugin3.8.0及更早版本存在信息泄露漏洞，该漏洞源于该插件实现了允许代理进程检索任何Vault机密以便在代理上使用的功能。攻击者可利用该漏洞通过控制代理进程来获取指定的路径和密钥。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2429', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2429', 'JenkinsHashiCorpVaultPlugin信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323326', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (278, 'CVE-2022-25185', 'CNVD-2022-16723', 'Jenkins Generic Webhook Trigger Plugin跨站脚本漏洞', '低(AV:N/AC:M/Au:S/C:N/I:P/A:N)', '1', 'Jenkins Generic Webhook Trigger Plugin <=1.81', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsGenericWebhookTriggerPlugin1.81及更早版本存在跨站脚本漏洞，该漏洞源于该插件缺少对用户提供的数据和输出的数据校验过滤。攻击者可利用该漏洞获取管理员cookie。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2592', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2592', 'JenkinsGenericWebhookTriggerPlugin跨站脚本漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323336', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (279, 'CVE-2022-25184', 'CNVD-2022-16724', 'Jenkins Pipeline Build Step Plugin信息泄露漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins Pipeline Build Step Plugin <=2.15', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsPipelineBuildStepPlugin2.15及更早版本存在信息泄露漏洞，该漏洞源于在使用管道代码段生成器生成管道脚本时显示密码参数默认值。攻击者可利用该漏洞获取敏感信息。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2519', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2519', 'JenkinsPipelineBuildStepPlugin信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323341', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (280, 'CVE-2022-25181', 'CNVD-2022-16725', 'Jenkins Pipeline Shared Groovy Libraries Plugin沙箱绕过漏洞', '中(AV:N/AC:L/Au:S/C:P/I:P/A:P)', '2', 'Jenkins Pipeline Shared Groovy Libraries Plugin <=552.vd9cc05b8a2e1', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsPipelineSharedGroovyLibrariesPlugin552.vd9cc05b8a2e1及更早版本存在沙箱绕过漏洞，该漏洞源于该插件使用相同的工作区目录来检出所有具有相同名称的Pipeline库，而不管使用的SCM和库配置的来源如何。攻击者可利用该漏洞在Jenkins控制器JVM上下文中通过精编的SCM内容执行任意代码。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2441', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2441', 'JenkinsPipelineSharedGroovyLibrariesPlugin沙箱绕过漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323351', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (281, 'CVE-2022-25180', 'CNVD-2022-16726', 'Jenkins Pipeline Groovy Plugin信息泄露漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins Pipeline Groovy Plugin <=2648.va9433432b33c', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsPipelineGroovyPlugin2648.va9433432b33c及更早版本存在信息泄露漏洞，该漏洞源于GroovyPlugin包含了来自于重放版本的原始版本的密码参数，攻击者可利用该漏洞获取敏感信息。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2443', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2443', 'JenkinsPipelineGroovyPlugin信息泄露漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323346', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (282, 'CVE-2022-25179', 'CNVD-2022-16727', 'Jenkins Pipeline Multibranch Plugin任意文件读取漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins Pipeline Multibranch Plugin <=706.vd43c65dec013', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsPipelineMultibranchPlugin706.vd43c65dec013及更早的版本存在任意文件读取漏洞，该漏洞源于Multibranch插件在使用readTrusted步骤读取文件时，使用符号链接指向已配置SCM的检出目录之外的位置。攻击者可利用该漏洞配置管道权限来读取Jenkins控制器文件系统上的任意文件。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2613', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2613', 'JenkinsPipelineMultibranchPlugin任意文件读取漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323356', '(暂无验证信息)', '2022-03-04', '2022-02-17', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (283, 'CVE-2022-25177', 'CNVD-2022-16728', 'Jenkins Pipeline Shared Groovy Libraries Plugin任意文件读取漏洞', '中(AV:N/AC:L/Au:S/C:P/I:N/A:N)', '2', 'Jenkins Pipeline Shared Groovy Libraries Plugin <=552.vd9cc05b8a2e1', 'Jenkins是Jenkins开源的一个应用软件。一个开源自动化服务器Jenkins提供了数百个插件来支持构建，部署和自动化任何项目。JenkinsPipelineSharedGroovyLibrariesPlugin552.vd9cc05b8a2e1及更早的版本存在任意文件读取漏洞，该漏洞源于共享Groovy库插件没有限制传递给libraryResource步骤的资源名。攻击者可利用该漏洞配置管道权限来读取Jenkins控制器文件系统上的任意文件。', '通用型漏洞', 'https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2613', '厂商已发布了漏洞修复程序，请及时关注更新：https://www.jenkins.io/security/advisory/2022-02-15/#SECURITY-2613', 'JenkinsPipelineSharedGroovyLibrariesPlugin任意文件读取漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/323361', '(暂无验证信息)', '2022-03-04', '2022-03-04', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (284, NULL, 'CNVD-2022-13895', '组态王（KingView）存在逻辑缺陷漏洞 ', '低(AV:L/AC:L/Au:N/C:N/I:P/A:P)', '1', '北京亚控科技发展有限公司 组态王（KingView） 7.5 SP4', '组态王（KingView）是中国设备监控领域的旗舰品牌，具有功能齐全、简单、易学、易用等特点，产品广泛应用于电力、机械、市政、能源、环保、医药等几十个行业，涉及上百种设备配套监控如低压配电、起重机械、真空炉、换热站、风机发电、吹灰除尘、空分设备、制药冻干机等等。组态王（KingView）存在逻辑缺陷漏洞，攻击者可利用该漏洞覆盖删除任意文件。', '通用型漏洞', '', '厂商已发布了漏洞修复程序，请及时关注更新：：http://www.kingview.com/', '组态王（KingView）存在逻辑缺陷漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/320626', '已验证', '2022-03-04', '2022-01-18', '2022-02-24', '2022-02-24', '附件暂不公开', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (285, NULL, 'CNVD-2022-13862', '四创科技有限公司山洪灾害监测预警平台存在文件上传漏洞（CNVD-2022-13862）', '高(AV:N/AC:L/Au:N/C:C/I:C/A:C)', '3', '四创科技有限公司 山洪灾害监测预警平台 ', '四创科技有限公司是中国减灾兴利信息服务提供商。四创科技有限公司山洪灾害监测预警平台存在文件上传漏洞，攻击者可利用该漏洞获取服务器权限。', '通用型漏洞', '', '厂商已提供漏洞修补方案，请关注厂商主页及时更新：http://iot.istrong.cn/', '四创科技有限公司山洪灾害监测预警平台存在文件上传漏洞（CNVD-2022-13862）的补丁：https://www.cnvd.org.cn/patchInfo/show/321951', '已验证', '2022-03-04', '2022-01-18', '2022-02-24', '2022-02-25', '附件暂不公开', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (286, NULL, 'CNVD-2022-13863', '四创科技有限公司山洪灾害监测预警平台存在SQL注入漏洞（CNVD-2022-13863）', '高(AV:N/AC:L/Au:N/C:C/I:N/A:N)', '3', '四创科技有限公司 山洪灾害监测预警平台 ', '四创科技有限公司是中国减灾兴利信息服务提供商。四创科技有限公司山洪灾害监测预警平台存在SQL注入漏洞，攻击者可利用该漏洞获取数据库敏感信息。', '通用型漏洞', '', '厂商已提供相关漏洞补丁链接，请关注厂商主页随时更新：https://www.istrong.cn/', '四创科技有限公司山洪灾害监测预警平台存在SQL注入漏洞（CNVD-2022-13863）的补丁：https://www.cnvd.org.cn/patchInfo/show/321511', '已验证', '2022-03-04', '2022-01-18', '2022-02-24', '2022-02-24', '附件暂不公开', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (287, NULL, 'CNVD-2022-13864', '四创科技有限公司山洪灾害监测预警平台存在SQL注入漏洞（CNVD-2022-13864）', '高(AV:N/AC:L/Au:N/C:C/I:N/A:N)', '3', '四创科技有限公司 山洪灾害监测预警平台 ', '四创科技有限公司是中国减灾兴利信息服务提供商。四创科技有限公司山洪灾害监测预警平台存在SQL注入漏洞，攻击者可利用该漏洞获取数据库敏感信息。', '通用型漏洞', '', '厂商已提供相关漏洞补丁链接，请关注厂商主页随时更新：https://www.istrong.cn/', '四创科技有限公司山洪灾害监测预警平台存在SQL注入漏洞（CNVD-2022-13864）的补丁：https://www.cnvd.org.cn/patchInfo/show/321496', '已验证', '2022-03-04', '2022-01-18', '2022-02-24', '2022-02-24', '附件暂不公开', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (288, NULL, 'CNVD-2022-13865', '四创科技有限公司山洪监测预警平台存在任意文件读取漏洞', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', '四创科技有限公司 山洪灾害监测预警平台 ', '四创科技有限公司是中国减灾兴利信息服务提供商。四创科技有限公司山洪监测预警平台存在任意文件读取漏洞，攻击者可利用该漏洞获取敏感信息。', '通用型漏洞', '', '厂商已提供相关漏洞补丁链接，请关注厂商主页随时更新：https://www.istrong.cn/', '四创科技有限公司山洪监测预警平台存在任意文件读取漏洞的补丁：https://www.cnvd.org.cn/patchInfo/show/321506', '已验证', '2022-03-04', '2022-01-18', '2022-02-24', '2022-02-24', '附件暂不公开', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (289, NULL, 'CNVD-2022-16708', 'WordPress插件Survey & Poll SQL注入漏洞', '高(AV:N/AC:L/Au:N/C:C/I:N/A:N)', '3', 'WordPress Survey and Poll 1.5.7.3', 'WordPress是基于PHP语言开发的博客平台，可以用于在支持PHP和MySQL数据库的服务器上架设网站，也可当做一个内容管理系统（CMS）。Survey&Poll是网站上游客直接反馈的解决方案。WordPress插件Survey&Poll存在SQL注入漏洞。攻击者可利用漏洞获取数据库敏感信息。', '通用型漏洞', 'https://www.exploit-db.com/exploits/50269', '目前没有详细解决方案提供：http://modalsurvey.pantherius.com/', NULL, '已验证', '2022-03-04', '2021-12-27', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
INSERT INTO `cnvds` VALUES (290, NULL, 'CNVD-2022-16707', 'WordPress插件WP Guppy敏感信息泄露漏洞', '中(AV:N/AC:L/Au:N/C:P/I:N/A:N)', '2', 'WordPress WP Guppy 1.1', 'WordPress是基于PHP语言开发的博客平台，可以用于在支持PHP和MySQL数据库的服务器上架设网站，也可当做一个内容管理系统（CMS）。WordPress插件WPGuppy存在敏感信息泄露漏洞。攻击者可借助特制的HTML页面利用该漏洞获取进程内存中的敏感信息。', '通用型漏洞', 'https://packetstormsecurity.com/files/165054/WordPress-WP-Guppy-1.1-Information-Disclosure.html', '目前没有详细解决方案提供：https://wp-guppy.com/', NULL, '已验证', '2022-03-04', '2021-11-24', '2022-03-04', '2022-03-04', '(无附件)', '2022-03-04', 'CNVD', '2022-03-05 01:16:21', NULL);
